import React from "react";
// import logo from "./logo.svg";
import "./App.css";
import Header from "./header";
import NavBar from "./navBar";
import SearchCard from "./searchCard";

const App = () => {
  const images = [
    "food1.jpg",
    "food2.jpg",
    "food3.jpg",
    "food4.jpg",
    "food5.jpg"
  ];

  const changeBackgroundImg = () => {
    return this.images[Math.random(0, this.images.length)];
  };
  return (
    <div className="App">
      <Header />
      <NavBar />
      <SearchCard prop={changeBackgroundImg} />
    </div>
  );
};

export default App;
